function Header() {
  return (
    <div className="flex  h-10 content-center bg-blue-300 tracking-tighter text-black font-semibold md:text-lg">
      <div className="basis-1/5">
        <a href="/">LOGO</a>
      </div>
      <div className="flex basis-3/5">for clients</div>
      <div className="flex basis-3/5">1</div>
      <div>2</div>
      <div>3</div>
      <div className="Language basis-1/5">Language</div>
      <div className="Login basis-1/5">
        <a href="!#">LOGIN</a>
      </div>
    </div>
  );
}

export default Header;
